import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import { makeStyles } from "@material-ui/core";
import RUhorizontal from "../assets/ipo_horizontal.png";
import MenuIcon from '@mui/icons-material/Menu';
import IconButton from '@mui/material/IconButton';

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: "#cc0033 !important",
    color: "white",
  },
  RUhorizontal: {
    width: "50vw",
    padding: "8px",
  },
  menuIcon: {
    marginLeft: "20px",
    "&:hover": {
      backgroundColor: "transparent" 
  }
  },
}));



const Navbar = () => {
  const classes = useStyles();
  const [isOpen, setIsOpen] = useState(false);

  return (
    <><AppBar className={classes.appBar} position="static">
      <Toolbar disableGutters>
        <IconButton onClick={() => setIsOpen(!isOpen)} edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
          <MenuIcon className={classes.menuIcon} />
        </IconButton>
        <img
          src={RUhorizontal}
          className={classes.RUhorizontal}
          alt="RUhorizontal" />
      </Toolbar>
    </AppBar><div> <Drawer
      isOpen={isOpen}
      onClose={() => setIsOpen(false)}
      position="left"
    >
      <div className="demo-content">
        <button type="button" onClick={() => setIsOpen(false)}>
          Close
        </button>
        <p>The drawer content!</p>
        <input type="text" />
      </div>
    </Drawer></div></>

  );
};
export default Navbar;
